import React from "react";
import "../Layout.css";

// Importera JSON-filer direkt
import howToJoinText from "../data/howToJoinText.json";
import clubRulesText from "../data/clubRulesText.json";
import membershipBenefitsText from "../data/membershipBenefitsText.json";

function ClubRules() {
  return (
    <div className="rules-container">
      <div className="outer-card">
        <h1>Bli Medlem</h1>
        <div className="inner-card">
          <ul>
            <h2>Hur blir jag medlem?</h2>
            {howToJoinText.paragraphs.map((rule, index) => (
              <li
                key={index}
                style={{
                  fontWeight: 600,
                  wordWrap: "break-word",
                  overflowWrap: "break-word",
                  marginBottom: "8px",
                }}
              >
                {rule}
              </li>
            ))}
          </ul>

          <ul>
            <h2 style={{ marginTop: "20px" }}>Klubbregler</h2>
            {clubRulesText.paragraphs.map((rule, index) => (
              <li
                key={index}
                style={{
                  fontWeight: 600,
                  wordWrap: "break-word",
                  overflowWrap: "break-word",
                  marginBottom: "8px",
                }}
              >
                {rule}
              </li>
            ))}
          </ul>

          <ul>
            <h2 style={{ marginTop: "20px" }}>Vad ing√•r i medlemskapet?</h2>
            {membershipBenefitsText.paragraphs.map((benefit, index) => (
              <li
                key={index}
                style={{
                  fontWeight: 600,
                  wordWrap: "break-word",
                  overflowWrap: "break-word",
                  marginBottom: "8px",
                }}
              >
                {benefit}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default ClubRules;
